		.background-animation {
    position: fixed;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    background: url('bg-whale.png') no-repeat 60% 10% /cover;
    z-index: -2;
}
        
        .stars {
            position: fixed;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            z-index: -1;
        }
        
        .star {
            position: absolute;
            background: #fff;
            border-radius: 50%;
            animation: twinkle 3s ease-in-out infinite alternate;
        }
        
        @keyframes gradientShift {
            0% { background-position: 0% 50%; }
            50% { background-position: 100% 50%; }
            100% { background-position: 0% 50%; }
        }
        
        @keyframes twinkle {
            from { opacity: 0.3; }
            to { opacity: 1; }
        }
        
        @keyframes float {
            0%, 100% { transform: translateY(0px); }
            50% { transform: translateY(-20px); }
        }
        
        @keyframes pulse {
            0%, 100% { transform: scale(1); }
            50% { transform: scale(1.05); }
        }
        
        @keyframes slideInLeft {
            from { transform: translateX(-100px); opacity: 0; }
            to { transform: translateX(0); opacity: 1; }
        }
        
        @keyframes slideInRight {
            from { transform: translateX(100px); opacity: 0; }
            to { transform: translateX(0); opacity: 1; }
        }
        
        @keyframes slideInUp {
            from { transform: translateY(50px); opacity: 0; }
            to { transform: translateY(0); opacity: 1; }
        }
        
        .container {
            max-width: 960px;
            margin: 0 auto;
            padding: 20px;
            position: relative;
            z-index: 1;
        }
        
        .header {
            text-align: center;
            margin-bottom: 40px;
            animation: slideInUp 1s ease-out;
        }
        
        .header h1 {
            font-size: 4rem;
            font-weight: 900;
            background: linear-gradient(45deg, #00ff88, #00ccff, #ff00ff, #ffff00);
            background-size: 300% 300%;
            -webkit-background-clip: text;
            -webkit-text-fill-color: transparent;
            background-clip: text;
            animation: gradientShift 3s ease infinite;
            text-shadow: 0 0 30px rgba(0,255,136,0.5);
            margin: 0;
        }
        
        .header .subtitle {
            font-size: 1.5rem;
            color: #00ccff;
            margin-top: 10px;
            text-shadow: 0 0 20px rgba(0,204,255,0.5);
        }
        
        .stats-container {
            display: grid;
            grid-template-columns: repeat(auto-fit, minmax(300px, 1fr));
            gap: 25px;
            margin-bottom: 40px;
            animation: slideInLeft 1s ease-out 0.3s both;
        }
        
        .stat-card {
            background: linear-gradient(135deg, rgba(0,255,136,0.1), rgba(0,204,255,0.1));
            border: 2px solid transparent;
            border-radius: 20px;
            padding: 30px;
            text-align: center;
            position: relative;
            overflow: hidden;
            transition: all 0.5s ease;
            animation: float 6s ease-in-out infinite;
            backdrop-filter: blur(10px);
        }
        
        .stat-card:nth-child(2) { animation-delay: -2s; }
        .stat-card:nth-child(3) { animation-delay: -4s; }
        .stat-card:nth-child(4) { animation-delay: -1s; }
        
        .stat-card::before {
            content: '';
            position: absolute;
            top: -2px;
            left: -2px;
            right: -2px;
            bottom: -2px;
            background: linear-gradient(45deg, #00ff88, #00ccff, #ff00ff, #ffff00);
            border-radius: 20px;
            z-index: -1;
            animation: gradientShift 4s ease infinite;
        }
        
        .stat-card:hover {
            transform: translateY(-10px) scale(1.05);
            box-shadow: 0 20px 40px rgba(0,255,136,0.3);
        }
        
        .stat-card h3 {
            font-size: 1.2rem;
            color: #00ccff;
            margin-bottom: 15px;
            text-transform: uppercase;
            letter-spacing: 2px;
        }
        
        .stat-card .value {
            font-size: 2.5rem;
            font-weight: 700;
            color: #00ff88;
            text-shadow: 0 0 20px rgba(0,255,136,0.7);
            animation: pulse 2s ease-in-out infinite;
        }
        
        .chart-section {
            background: linear-gradient(135deg, rgba(255,255,255,0.05), rgba(255,255,255,0.1));
            border-radius: 25px;
            padding: 40px;
            margin: 40px 0;
            backdrop-filter: blur(15px);
            border: 1px solid rgba(255,255,255,0.1);
            animation: slideInRight 1s ease-out 0.6s both;
        }
        
        .chart-container {
            position: relative;
            height: 500px;
            margin: 20px 0;
        }
        
        .transactions-grid {
            display: grid;
            grid-template-columns: repeat(auto-fill, minmax(350px, 1fr));
            gap: 20px;
            margin-top: 40px;
            animation: slideInUp 1s ease-out 0.9s both;
        }
        
        .transaction-card {
            background: linear-gradient(135deg, rgba(0,255,136,0.1), rgba(0,204,255,0.1));
            border-radius: 15px;
            padding: 25px;
            border: 1px solid rgba(0,255,136,0.3);
            transition: all 0.4s ease;
            position: relative;
            overflow: hidden;
        }
        
        .transaction-card::before {
            content: '';
            position: absolute;
            top: 0;
            left: -100%;
            width: 100%;
            height: 100%;
            background: linear-gradient(90deg, transparent, rgba(255,255,255,0.1), transparent);
            transition: left 0.6s ease;
        }
        
        .transaction-card:hover::before {
            left: 100%;
        }
        
        .transaction-card:hover {
            transform: translateY(-5px) scale(1.02);
            border-color: #00ff88;
            box-shadow: 0 15px 30px rgba(0,255,136,0.2);
        }
        
        .transaction-header {
            display: flex;
            justify-content: space-between;
            align-items: center;
            margin-bottom: 15px;
        }
        
        .transaction-time {
            font-size: 1.1rem;
            color: #00ccff;
            font-weight: 600;
        }
        
        .transaction-amount {
            font-size: 1.8rem;
            color: #00ff88;
            font-weight: 700;
            text-shadow: 0 0 15px rgba(0,255,136,0.5);
        }
        
        .large-transaction {
            border-color: #ff00ff;
            background: linear-gradient(135deg, rgba(255,0,255,0.1), rgba(255,255,0,0.1));
        }
        
        .large-transaction .transaction-amount {
            color: #ff00ff;
            text-shadow: 0 0 15px rgba(255,0,255,0.5);
            font-size: 2.2rem;
        }
        
        .crypto-icon {
            display: inline-block;
            width: 30px;
            height: 30px;
            background: linear-gradient(45deg, #f7931a, #ffaa00);
            border-radius: 50%;
            margin-left: 10px;
            animation: pulse 2s ease-in-out infinite;

        .section-title {
            font-size: 2.5rem;
            color: #00ff88;
            text-align: center;
            margin: 40px 0 30px 0;
            text-shadow: 0 0 20px rgba(0,255,136,0.5);
            text-transform: uppercase;
            letter-spacing: 3px;
        }

        /* Calendar Styles - Made smaller */
        .calendar-container {
            background: rgba(0,0,0,0.3); 
            border-radius: 12px; 
            padding: 15px; 
            border: 1px solid rgba(0,255,136,0.3);
            max-width: 280px;
            margin: 0 auto;
        }

        .calendar-header {
            text-align: center; 
            color: #00ff88; 
            font-weight: bold; 
            margin-bottom: 12px; 
            font-size: 1rem;
        }

        .calendar-grid {
            display: grid; 
            grid-template-columns: repeat(7, 28px); 
            gap: 3px; 
            justify-content: center;
        }

        .calendar-day {
            width: 28px; 
            height: 28px; 
            display: flex; 
            align-items: center; 
            justify-content: center; 
            border-radius: 6px; 
            cursor: pointer; 
            font-size: 0.8rem; 
            font-weight: bold;
            transition: all 0.3s ease;
            border: 1px solid rgba(255,255,255,0.2);
        }

        .calendar-day.has-data {
            background: none; /* No color */
            color: #00ff88; /* Keep text color visible */
            box-shadow: none; /* Remove glow */
            border: 1px solid rgba(0,255,136,0.5); /* subtle border to show it has data */
        }

        .calendar-day.selected {
            background: linear-gradient(45deg, #00ff88, #00ccff); /* bright background */
            color: #000;
            border: 2px solid #ffd700;
            box-shadow: 0 0 12px rgba(255,215,0,0.8);
        }

        .calendar-day.no-data {
            background: rgba(255,255,255,0.1); 
            color: #888;
        }

        .calendar-day:hover.has-data {
            transform: scale(1.15);
            box-shadow: 0 0 10px rgba(0,255,136,0.4);
        }

        .calendar-day-header {
            text-align: center; 
            color: #00ccff; 
            font-size: 0.7rem; 
            font-weight: bold; 
            padding: 2px;

        .selected-dates-info {

            color: #ffaa00;
            text-align: center;

        .clear-selection-btn {

            color: white;
            padding: 8px 16px;
            border-radius: 6px;
            cursor: pointer;
            font-size: 0.8rem;
            margin-top: 10px;

        .clear-selection-btn:hover {

        /* Search bar styles */
        .search-container {
            margin: 20px auto;
            max-width: 600px;

        .search-container input {

            border: 2px solid #00ff88;
            border-radius: 25px;
            background-color: rgba(0, 0, 0, 0.5);
            color: #fff;
            font-size: 1rem;
            outline: none;
            transition: all 0.3s ease;
            margin-right: 10px; /* Space between input and button */
        }

        .search-container input::placeholder {
            color: rgba(255, 255, 255, 0.7);
        }

        .search-container input:focus {
            border-color: #00ccff;
            box-shadow: 0 0 15px rgba(0, 204, 255, 0.5);

        .clear-wallet-search-btn {
            background: linear-gradient(45deg, #00ccff, #007bff);
            border: none;
            color: white;
            padding: 12px 20px;
            border-radius: 25px;
            cursor: pointer;
            font-size: 1rem;
            font-weight: bold;
            transition: all 0.3s ease;
            white-space: nowrap; /* Prevent text wrapping */
        }

        .clear-wallet-search-btn:hover {
            transform: translateY(-2px);
            box-shadow: 0 0 15px rgba(0, 204, 255, 0.5);
        }
		/* CSS for disabled state and "Claimed" stamp */
        .transaction-card.claimed {
            background: rgba(128, 128, 128, 0.3); /* Gray with some transparency */
            color: #bbb; /* Lighter text color */
            pointer-events: none; /* Disable click events */
            position: relative;
            overflow: hidden;
            border-color: rgba(128, 128, 128, 0.5);
        }

        .transaction-card.claimed::after {
            content: "Claimed";
            position: absolute;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%) rotate(-25deg);
            background-color: rgba(0, 0, 0, 0.7);
            color: #00ff88;
            padding: 10px 20px;
            border-radius: 8px;
            font-size: 1.8rem;
            font-weight: 900;
            opacity: 0.8;
            z-index: 10;
            border: 2px solid #00ff88;
            text-shadow: 0 0 10px rgba(0,255,136,0.7);
        }

        /* Optional: Adjust hover effect for claimed cards */
        .transaction-card.claimed:hover {
            transform: none; /* No movement on hover */
            box-shadow: none; /* No shadow on hover */
            border-color: rgba(128, 128, 128, 0.5); /* Keep border color */
        }

        .transaction-card.claimed::before {
            display: none; /* Hide the swipe animation */
        }

		// Helper function to check if a transaction is claimed
function isTransactionClaimed(transaction) {
    return transactionsClaim.some(claimedTx =>
        // Compare relevant properties to determine if it's the same transaction
        claimedTx.amount === transaction.amount &&
        claimedTx.address === transaction.address &&
        // You might also want to compare 'time' or 'date' if they are unique enough
        // For simplicity, let's keep it to amount, address, and contact for now.
        claimedTx.contact === transaction.contact
    );
}

// Function to update transaction cards (modified to include 'claimed' logic)
function updateTransactionCards() {
    // Remove existing transaction cards (keep the summary card)
    const existingCards = document.querySelectorAll('.transaction-card:not(:first-child)');
    existingCards.forEach(card => card.remove());
    
    // If no transactions, show "No one to claim"
    if (currentTransactions.length === 0) {
        const noDataCard = document.createElement('div');
        noDataCard.className = 'transaction-card';
        noDataCard.style.border = '2px solid #ffaa00';
        noDataCard.style.background = 'rgba(255,255,255,0.05)';
        noDataCard.style.color = '#ffaa00';
        noDataCard.style.textAlign = 'center';
        noDataCard.style.fontSize = '1rem';
        noDataCard.style.padding = '20px';
        noDataCard.textContent = 'No one to claim';
        transactionsGrid.appendChild(noDataCard);
        return;
    }
    
    // Add new transaction cards
    currentTransactions.forEach((transaction, index) => {
        const card = document.createElement('div');
        card.className = `transaction-card`;
        
        // Check if the transaction is claimed and add the 'claimed' class
        if (isTransactionClaimed(transaction)) {
            card.classList.add('claimed');
        }

        if (transaction.amount >= 10000) { 
            card.classList.add('large-transaction');
        }
        
        card.style.animationDelay = (index * 0.1) + 's';
        
        // Truncate wallet address for display
        const displayAddress = `${transaction.address.substring(0, 6)}...${transaction.address.slice(-4)}`;

        card.innerHTML = `
            <div class="transaction-header">
                <div class="transaction-time">⏰ ${transaction.time.split(' ')[1]}<br><span style="font-size: 0.8rem; opacity: 0.7;">${transaction.time.split(' ')[0]}</span></div>
                <div class="transaction-amount">
                    ${transaction.amount.toLocaleString()} USDT
                    ${transaction.amount >= 10000 ? '🔥' : '💎'}
                </div>
            </div>
            <div style="font-size: 0.9rem; color: #00ccff; opacity: 0.8; margin-bottom: 10px;">
                Claim Alert #
                ${transaction.amount >= 10000 ? ' • HIGH PRIORITY ALERT' : ' • STANDARD ALERT'}
            </div>
            <div style="font-size: 0.85rem; color: #ffaa00; opacity: 0.9; margin-bottom: 5px;">
                📱 Wallet Address: <span style="color: #00ff88; font-family: monospace;">${displayAddress}</span>
            </div>
            <div style="font-size: 0.85rem; color: #ffaa00; opacity: 0.9;">
                📅 Smart Contact: <span style="color: #00ccff; font-weight: bold;">${transaction.contact} Days</span>
            </div>
        `;
        
        transactionsGrid.appendChild(card);
    });
    
    // Re-add hover effects only for non-claimed cards
    document.querySelectorAll('.transaction-card:not(.claimed)').forEach(card => {
        card.addEventListener('mouseenter', () => {
            card.style.transform = 'translateY(-10px) scale(1.03)';
        });
        
        card.addEventListener('mouseleave', () => {
            card.style.transform = 'translateY(0) scale(1)';
        });
    });
}

                            },
                            callback: function(value) {
                                return value.toLocaleString() + ' USDT';
                            }
                        }
                    },
                    x: {
                        grid: {
                            color: 'rgba(0, 204, 255, 0.2)',
                            lineWidth: 1
                        },
                        ticks: {
                            color: '#00ccff',
                            font: {
                                family: 'Roboto',
                                size: 12,
                                weight: 'bold'
                            }
                        }
                    }
                },
                interaction: {
                    intersect: false,
                    mode: 'index'
                },
                animation: {
                    duration: 2000,
                    easing: 'easeInOutQuart'
                }
            }
        });

        // Create transaction cards with total summary box and calendar
        const transactionsGrid = document.getElementById('transactionsGrid');
        
        // Add total summary card with smaller calendar
        const totalCard = document.createElement('div');
        totalCard.className = 'transaction-card';
        totalCard.style.background = 'linear-gradient(135deg, rgba(255,215,0,0.2), rgba(255,140,0,0.2))';
        totalCard.style.border = '2px solid #ffd700';
        totalCard.style.gridColumn = '1 / -1';
        totalCard.style.display = 'flex';
        totalCard.style.justifyContent = 'space-between';
        totalCard.style.alignItems = 'flex-start';
        totalCard.innerHTML = `
            <div style="margin-right: 30px;">
                <div class="calendar-container">
                   <div class="calendar-header">
                    <div class="calendar-controls">📅
  <select id="monthSelect">
    <option value="0">January</option>
    <option value="1">February</option>
    <option value="2">March</option>
    <option value="3">April</option>
    <option value="4">May</option>
    <option value="5">June</option>
    <option value="6">July</option>
    <option value="7">August</option>
    <option value="8">September</option>
    <option value="9">October</option>
    <option value="10">November</option>
    <option value="11">December</option>
  </select>

  <select id="yearSelect">
    <option value="2025">2025</option>
    <option value="2026">2026</option>
    <option value="2027">2027</option>
  </select>
</div>
                    </div>
                    <div class="calendar-grid" id="calendarGrid">
                        </div>
                    <div class="selected-dates-info" id="selectedDatesInfo">
                        Click dates to select multiple
                    </div>
                    <button class="clear-selection-btn" onclick="clearSelection()">Clear All</button>
                </div>
            </div>
            <div style="flex: 1;">
                <div class="transaction-header">
                    <div class="transaction-time">📊 Total Claims Summary</div>
                    <div class="transaction-amount" style="color: #ffd700; text-shadow: 0 0 15px rgba(255,215,0,0.7);">
                        <span id="totalAmount">325</span> USDT 💰
                    </div>
                </div>
                <div style="font-size: 0.9rem; color: #ffaa00; opacity: 0.9;">
                    Total of <span id="totalClaims">1</span> claims made on <span id="selectedDate">4/6/2025</span>
                </div>
            </div>
        `;
        transactionsGrid.appendChild(totalCard);

        function getMonthYear(dateStr) {
            const [day, month, year] = dateStr.split('/').map(num => parseInt(num));
            const dateObj = new Date(year, month - 1, day);
            return dateObj.toLocaleDateString('en-GB', { month: 'long', year: 'numeric' });
        } 
        
        // Generate smaller calendar
        function generateCalendar() {
            const calendarGrid = document.getElementById('calendarGrid');
            calendarGrid.innerHTML = ''; // Clear existing calendar
            
            const date = new Date(currentYear, currentMonth, 1);
            const daysInMonth = new Date(currentYear, currentMonth + 1, 0).getDate();
            const startDay = date.getDay();
            
            // Add day headers
            const dayHeaders = ['S', 'M', 'T', 'W', 'T', 'F', 'S'];
            dayHeaders.forEach(day => {
                const header = document.createElement('div');
                header.className = 'calendar-day-header';
                header.textContent = day;
                calendarGrid.appendChild(header);
            });
            
            // Add empty cells for days before month starts
            for (let i = 0; i < startDay; i++) {
                const emptyDay = document.createElement('div');
                emptyDay.className = 'calendar-day';
                calendarGrid.appendChild(emptyDay);
            }
            
            // Add days of the month
            for (let day = 1; day <= daysInMonth; day++) {
                const dayElement = document.createElement('div');
                const dateStr = `${day}/${currentMonth+1}/${currentYear}`;
                const dayTransactions = transactions.filter(t => t.date === dateStr);
                const hasTransactions = dayTransactions.length > 0;
                const isSelected = selectedDates.includes(dateStr);
                
                dayElement.className = 'calendar-day';
                if (hasTransactions) {
                    dayElement.classList.add('has-data');
                } else {
                    dayElement.classList.add('no-data');
                }
                
                if (isSelected) {
                    dayElement.classList.add('selected');
                }
                
                dayElement.textContent = day;
                dayElement.addEventListener('click', () => toggleDate(dateStr));
                
                calendarGrid.appendChild(dayElement);
            }
            
            updateSelectedDatesInfo();
        }
        
        // Function to toggle date selection (multi-select)
        function toggleDate(dateStr) {
            const dayTransactions = transactions.filter(t => t.date === dateStr);
            
            // Only allow selection of dates that have data
            if (dayTransactions.length === 0) {
                return;
            }
            
            const index = selectedDates.indexOf(dateStr);
            if (index > -1) {
                // Date is already selected, remove it
                selectedDates.splice(index, 1);
            } else {
                // Date is not selected, add it
                selectedDates.push(dateStr);
            }
            
            // Sort selected dates
            selectedDates.sort((a, b) => {
                const [dayA, monthA, yearA] = a.split('/').map(Number);
                const [dayB, monthB, yearB] = b.split('/').map(Number);
                return new Date(yearA, monthA - 1, dayA) - new Date(yearB, monthB - 1, dayB);
            });
            
            updateDisplay();
        }
        
        // Function to clear all selections
        function clearSelection() {
            selectedDates = [];
            updateDisplay();
        }
        
        // Function to update selected dates info display
        function updateSelectedDatesInfo() {
            const infoElement = document.getElementById('selectedDatesInfo');
            if (selectedDates.length === 0) {
                infoElement.textContent = 'Click dates to select multiple';
                infoElement.style.color = '#ffaa00';
            } else {
                const dateList = selectedDates.map(date => date.split('/')[0]).join(', ');
                infoElement.innerHTML = `Selected dates: <span style="color: #00ff88; font-weight: bold;">${dateList}</span>`;
                infoElement.style.color = '#00ccff';
            }
        }
        
        // Function to update entire display
        function updateDisplay() {
            let filteredTransactions;

            // If a search query is present, ignore calendar dates and search all transactions
            if (searchQuery) {
                let effectiveSearchQuery = searchQuery.toLowerCase().replace(/\s/g, '');

                if (effectiveSearchQuery.length > 10 && effectiveSearchQuery.startsWith('0x')) {
                    effectiveSearchQuery = `${effectiveSearchQuery.substring(0, 4)}...${effectiveSearchQuery.slice(-4)}`;
                }

                filteredTransactions = transactions.filter(t => {
                    const normalizedTransactionAddress = t.address.toLowerCase();
                    return normalizedTransactionAddress.includes(effectiveSearchQuery);
                });
                
                // When searching, update subtitle to reflect "Search Results"
                document.getElementById('subtitleDate').textContent = `Search Results for "${searchQuery}" • Claims Alert Dashboard`;

            } else {
                // If no search query, filter by selected dates (original behavior)
                filteredTransactions = transactions.filter(t => selectedDates.includes(t.date));
                updateSubtitle(); // Revert subtitle to date display
            }

            currentTransactions = filteredTransactions;
            
            // Sort transactions by time
            currentTransactions.sort((a, b) => new Date(a.time) - new Date(b.time));
            
            // Update summary
            const totalAmount = currentTransactions.reduce((sum, t) => sum + t.amount, 0);
            const totalClaimed = currentTransactions.reduce((sum, t) => sum + t.amount, 0);
            const claimsMade = currentTransactions.length;
            const largestClaim = currentTransactions.length > 0 ? Math.max(...currentTransactions.map(t => t.amount)) : 0;
            const averageClaim = claimsMade > 0 ? (totalClaimed / claimsMade) : 0;

            document.getElementById('totalAmount').textContent = totalAmount.toLocaleString();
            document.getElementById('totalClaims').textContent = currentTransactions.length;
            
            document.querySelector('.stat-card:nth-child(1) .value').textContent = totalClaimed.toLocaleString() + ' USDT';
            document.querySelector('.stat-card:nth-child(2) .value').textContent = claimsMade;
            document.querySelector('.stat-card:nth-child(3) .value').textContent = largestClaim.toLocaleString();
            document.querySelector('.stat-card:nth-child(4) .value').textContent = averageClaim.toFixed(2);
            
            if (selectedDates.length === 1) {
                const formattedDate = new Date(
                    selectedDates[0].split('/')[2],
                    selectedDates[0].split('/')[1]-1,
                    selectedDates[0].split('/')[0]
                ).toLocaleDateString('en-GB', options).replace(/ /g, ' ');
                document.getElementById('selectedDate').textContent = formattedDate;
                if (!searchQuery) updateSubtitle(formattedDate);
            } else if (selectedDates.length > 1) {
                const dateList = selectedDates.map(date => date.split('/')[0]).join(', ');
                document.getElementById('selectedDate').textContent = `Dates: ${dateList}`;
                if (!searchQuery) updateSubtitle(`Dates: ${dateList}`);
            } else {
                document.getElementById('selectedDate').textContent = 'No dates selected';
                if (!searchQuery) updateSubtitle('No dates selected');
            }
            
            // Update chart
            chart.data.labels = currentTransactions.map(t => `${t.time.split(' ')[0]} ${t.time.split(' ')[1]}`);
            chart.data.datasets[0].data = currentTransactions.map(t => t.amount);
            chart.update();
            
            // Update transaction cards
            updateTransactionCards();
            
            // Update calendar display
            generateCalendar();
        }
        
		// --- NEW: Highlight today automatically ---
        const options = { day: '2-digit', month: 'long', year: 'numeric' };
        function updateSubtitle() {
            if (selectedDates.length === 0) {
                // Show general dashboard title if no dates selected
                document.getElementById('subtitleDate').textContent = `Claims Alert Dashboard`;
            } else if (selectedDates.length === 1) {
                const dateNumber = selectedDates[0].split('/')[0].padStart(2, '0');
                const monthYear = getMonthYear(selectedDates[0]);
                document.getElementById('subtitleDate').textContent = `${dateNumber} ${monthYear} • Claims Alert Dashboard`;
            } else {
                const dateList = selectedDates.map(date => date.split('/')[0].padStart(2, '0')).join(', ');
                // Use month/year from the first selected date (assume same month)
                const monthYear = getMonthYear(selectedDates[0]);
                document.getElementById('subtitleDate').textContent = `${dateList} ${monthYear} • Claims Alert Dashboard`;
            }
        }


        // Initialize the display
		
		
        updateDisplay();
    </script>
	<script>
        let currentMonth = new Date().getMonth();
        let currentYear = new Date().getFullYear();

        document.getElementById('monthSelect').value = currentMonth;
        document.getElementById('yearSelect').value = currentYear;

        document.getElementById('monthSelect').addEventListener('change', updateCalendarFromDropdown);
        document.getElementById('yearSelect').addEventListener('change', updateCalendarFromDropdown);

        function updateCalendarFromDropdown() {
            currentMonth = parseInt(document.getElementById('monthSelect').value);
            currentYear = parseInt(document.getElementById('yearSelect').value);
            updateDisplay();
        }

        // Search functionality
        const walletSearchInput = document.getElementById('walletSearch');
        walletSearchInput.addEventListener('input', (event) => {
            searchQuery = event.target.value.trim();
            updateDisplay(); // Re-render the display with the new search query
        });

        // Clear Wallet Search Button functionality
        const clearWalletSearchBtn = document.getElementById('clearWalletSearchBtn');
        clearWalletSearchBtn.addEventListener('click', () => {
            walletSearchInput.value = ''; // Clear the input field
            searchQuery = ''; // Clear the search query variable
            updateDisplay(); // Update the display
        });


        window.addEventListener('DOMContentLoaded', () => {
            updateDisplay();
        });
</script>
</body>
</html>
